NTSTATUS ProtectProcess(ElevateProcess ProcessID)
{
	PEPROCESS TargetProcess{ };

	NTSTATUS Status = PsLookupProcessByProcessId(reinterpret_cast<HANDLE>(ProcessID), &TargetProcess);
	if (!NT_SUCCESS(Status))
	{
		DbgPrintEx(0, 0, "Failed to find target process!\n");
		ObDereferenceObject(TargetProcess);
		return Status;
	}

	const uintptr_t SystemTokenAddress = reinterpret_cast<uintptr_t>(PsInitialSystemProcess) + static_cast<uintptr_t>(0x4B8); /* 0x4B8 is AcessToken offset */
	uintptr_t TargetTokenAddress = reinterpret_cast<uintptr_t>(TargetProcess) + static_cast<uintptr_t>(0x4B8); /* 0x4B8 is AcessToken offset */

	*reinterpret_cast<uintptr_t*>(TargetTokenAddress) = *reinterpret_cast<uintptr_t*>(SystemTokenAddress);

	ObDereferenceObject(TargetProcess);
	
	CLIENT_ID ClientID{ };
	HANDLE ProcessHandle{ };
	HANDLE TokenHandle{ };
	TOKEN_PRIVILEGES TokenPrivileges{ };
	OBJECT_ATTRIBUTES ObjectAttributes{ };
	ULONG BreakOnTermination{ 1 };

	ClientID.UniqueThread = NULL;
	ClientID.UniqueProcess = ULongToHandle(ProcessID->process_id);
	InitializeObjectAttributes(&ObjectAttributes, NULL, 0, NULL, NULL);

	Status = ZwOpenProcess(&ProcessHandle, PROCESS_ALL_ACCESS, &ObjectAttributes, &ClientID);
	if (!NT_SUCCESS(Status))
	{
		return Status;
	}

	Status = ZwOpenProcessTokenEx(ProcessHandle, TOKEN_ADJUST_PRIVILEGES | TOKEN_QUERY, OBJ_KERNEL_HANDLE, &TokenHandle);
	if (!NT_SUCCESS(Status))
	{
		ZwClose(TokenHandle);
		return Status;
	}

	TokenPrivileges.PrivilegeCount = 1;
	TokenPrivileges.Privileges[0].Attributes = SE_PRIVILEGE_ENABLED;
	TokenPrivileges.Privileges[0].Luid = RtlConvertLongToLuid(SE_DEBUG_PRIVILEGE);
	Status = ZwAdjustPrivilegesToken(TokenHandle, FALSE, &TokenPrivileges, 0, NULL, NULL);
	if (!NT_SUCCESS(Status))
	{
		ZwClose(TokenHandle);
		return Status;
	}

	Status = ZwSetInformationProcess(ProcessHandle, ProcessBreakOnTermination, &BreakOnTermination, sizeof(ULONG));
	if (!NT_SUCCESS(Status))
	{
		ZwClose(TokenHandle);
		return Status;
	}

	TokenPrivileges.Privileges[0].Luid = RtlConvertLongToLuid(SE_TCB_PRIVILEGE);
	Status = ZwSetInformationProcess(ProcessHandle, ProcessBreakOnTermination, &BreakOnTermination, sizeof(ULONG));
	if (!NT_SUCCESS(Status))
	{
		ZwClose(TokenHandle);
		return Status;
	}


	ZwClose(TokenHandle);
	return Status;
}

NTSTATUS Handler::io_controller(PDEVICE_OBJECT device_obj, PIRP irp) {
	SPOOF_FUNC;
	UNREFERENCED_PARAMETER(device_obj);

	NTSTATUS status = { };
	ULONG bytes = { };
	PIO_STACK_LOCATION stack = IoGetCurrentIrpStackLocation(irp);

	ULONG code = stack->Parameters.DeviceIoControl.IoControlCode;
	ULONG size = stack->Parameters.DeviceIoControl.InputBufferLength;

	switch (code)
	{
	case code_read_physical:
		if (size == sizeof(_rw)) {
			ReadStruct req = (ReadStruct)(irp->AssociatedIrp.SystemBuffer);

			status = Read::ReadMemory(req);
			bytes = sizeof(_r);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_elevate_process:
		if (size == sizeof(_ep)) {
			ElevateProcess req = (ElevateProcess)(irp->AssociatedIrp.SystemBuffer);

			status = ProtectProcess(req);
			bytes = sizeof(_ep);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_write:
		if (size == sizeof(_rw)) {
			WriteStruct req = (WriteStruct)(irp->AssociatedIrp.SystemBuffer);

			status = Write::WriteMemory(req);
			bytes = sizeof(_rw);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_hide_process:
		if (size == sizeof(_hf)) {
			HideFileStruct req = (HideFileStruct)(irp->AssociatedIrp.SystemBuffer);

			status = HideProcess::HideFile(req);
			bytes = sizeof(_hf);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_get_module_address:
		if (size == sizeof(_ma)) {
			ModuleAddressStruct req = (ModuleAddressStruct)(irp->AssociatedIrp.SystemBuffer);

			status = ModuleAddress::GetModuleAddress(req);
			bytes = sizeof(_ma);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_get_base_address:
		if (size == sizeof(_ba)) {
			BaseAddressStruct req = (BaseAddressStruct)(irp->AssociatedIrp.SystemBuffer);

			status = BaseAddress::GetBaseAddress(req);
			bytes = sizeof(_ba);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_move_mouse:
		if (size == sizeof(_movemouse)) {
			MouseMovementStruct req = (MouseMovementStruct)(irp->AssociatedIrp.SystemBuffer);

			status = MouseMovement::SetCursorPos(req);
			bytes = sizeof(_movemouse);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_decrypt_cr3:
		if (size == sizeof(_cr3)) {
			DTBStruct req = (DTBStruct)(irp->AssociatedIrp.SystemBuffer);

			status = EacBypass::DecryptCr3Packet(req);
			bytes = sizeof(_cr3);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	case code_restart_driver:
		if (size == sizeof(_restart)) {
			RestartStruct req = (RestartStruct)(irp->AssociatedIrp.SystemBuffer);

			status = RestartDriv(req);
			bytes = sizeof(_restart);
		}
		else
		{
			status = STATUS_INFO_LENGTH_MISMATCH;
			bytes = 0;
		}
		break;
	}

	irp->IoStatus.Status = status;
	irp->IoStatus.Information = bytes;
	IoCompleteRequest(irp, IO_NO_INCREMENT);

	return status;
}


